$SB = $null

Function Seatbelt {

if ($SB -ne "TRUE") {
    $script:SB = "TRUE"
    echo "Loading Assembly"
    $PS = ""
    $dllbytes  = [System.Convert]::FromBase64String($PS)
    $assembly = [System.Reflection.Assembly]::Load($dllbytes)
}

$output = [Seatbelt.Run]::All()
Write-Output ("[+] SB:")
Write-Output $output
}